In https://github.com/borisyankov/DefinitelyTyped/pull/4623 @gustavderdrache defined the type of `d3.event` to be `Event` where `Event` is defined as:

``` typescript
interface Event extends KeyboardEvent, MouseEvent {}
```

However, I don't think this is correct. `d3.event` will be a `KeyboardEvent` _or_ a `MouseEvent` (or indeed other event types, see below). In which case a union type is the more correct definition.

Indeed with zooming, `d3.event` can also be [another type](https://github.com/mbostock/d3/wiki/Zoom-Behavior#event):

``` typescript
interface ZoomEvent {
  scale: number;
  translate: [number, number];
}
```

It can also be a [drag event](https://github.com/mbostock/d3/wiki/Drag-Behavior#on), hence I have defined this type as well (per the definition in the D3 docs) and fixed up the use of `any` in the tests.

Tests updated, @gustavderdrache would appreciate your thoughts.

